    false,nt"url": null,nt"notes": "The TIGER/Line shapefiles and related database
    files (.dbf) are an extract of selected geographic and cartographic information
    from then               U.S. Census Bureau's Master Address File / Topologically
    Integrated Geographic Encoding and Referencing (MAF/TIGER) Database (MTDB). The
    MTDB representsn               a seamless national file with no overlaps or gaps
    between parts, however, each TIGER/Line shapefile is designed to stand alone as
    an independent datan               set, or they can be combined to cover the entire
    nation. Block Groups (BGs) are defined before tabulation block delineation and numbering,
    but aren               clusters of blocks within the same census tract that have
    the same first digit of their 4-digit census block number from the same decennial
    census. Forn               example, 2010 Census tabulation blocks 3001, 3002, 3003,..,
    3999 within 2010 Census tract 1210.02 are also within BG 3 within that census tract.
    2010n               Census BGs generally contained between 600 and 3,000 people.
    Most BGs were delineated by local participants in the Census Bureau's Participantn
                  Statistical Areas Program (PSAP). The Census Bureau delineated BGs
    only where the PSAP participant declined to delineate BGs or where the Census Bureaun
                  could not identify any local PSAP participant. A BG usually covers
    a contiguous area. Each census tract contains at least one BG, and BGs are uniquelyn
                  numbered within census tract. Within the standard census geographic
    hierarchy, BGs never cross county or census tract boundaries, but may cross then
                  boundaries of other geographic entities like county subdivisions,
    places, urban areas, voting districts, congressional districts, and American Indian
    /n               Alaska Native / Native Hawaiian areas. BGs have a valid code range
    of 0 through 9. BGs coded 0 were intended to only include water area, no land area,n
                  and they are generally in territorial seas, coastal water, and Great
    Lakes water areas. For the 2010 Census, rather than extending a census tractn               boundary
    into the Great Lakes or out to the U.S. nautical three-mile limit, the Census Bureau
    delineated some census tract boundaries along the shorelinen               or just
    offshore. The Census Bureau assigned a default census tract number beginning with
    99 and a BG number of 0 to these offshore, water-only areas notn               included
    in regularly numbered census tract areas.",nt"license_title": null,nt"extras":
